    var dataItems = [];
    var childrens=[];

    link.forEach((item) => {
      let elementKey= Object.keys(dataItems).find(key => dataItems[key].name === item.from);
      let elementItem= Object.keys(yData).find(key => yData[key].id === item.from);
      let elementItemChild= Object.keys(yData).find(key => yData[key].id === item.to);

      if (!elementKey){
        
        dataItems.push({
          name: yData[elementItem].id,
          description: yData[elementItem].size>=10?yData[elementItem].label:"",
          fontSize:  15,
          linkWith: [item.to],
          value: yData[elementItem].size,
          linkWidth: 1,
          fill: colorArray[yData[elementItem].group],
          children: []
        });

        childrens[yData[elementItem].id]=[{
          name: yData[elementItemChild].id,
          description:  yData[elementItemChild].size>=10?yData[elementItemChild].label:"",
          fontSize: parseInt(item.width),
          linkWith: [],
          value: parseInt(item.width),
          linkWidth: 1,
          fill: colorArray[yData[elementItemChild].group],
          children: []
        }];
        
      }else{

        dataItems[elementKey].linkWith.push(item.to);

        childrens[yData[elementItem].id].push({
          name: yData[elementItemChild].id,
          description: yData[elementItemChild].size>=10?yData[elementItemChild].label:"",
          fontSize: parseInt(item.width),
          linkWith: [],
          value: parseInt(item.width),
          linkWidth: 1,
          fill: colorArray[yData[elementItemChild].group],
          children: []
        });
      }
    });

    dataItems.forEach((item) => {
      item.children=childrens[item.name];
    });

